  `title` varchar(100) CHARACTER SET utf8mb3 COLLATE utf8mb3_general_ci DEFAULT NULL,
  `provider` varchar(255) DEFAULT NULL,
  `icon` varchar(500) DEFAULT NULL,
  `show` int NOT NULL DEFAULT '1',
  `priority` int NOT NULL DEFAULT '0',
